  false,\n\t\"url\": null,\n\t\"notes\": \"This is a plan that outlines working habitat
  objectives for wetland habitats based on refuge purposes, professional judgment
  and experience. Wetland objectives provided the necessary framework to write the
  annual work plan to detail most of the annual tasks described in this report. This
  plan also serves to record habitat management actions applied to refuge ecosystems
  during 2003, and document subsequent results (vegetation responses and wildlife
  use in 2003). This plan also delineates new management strategies and prescriptions
  for the next management cycle of 2004.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
